import { Component } from '@angular/core';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import { Store } from '@ngrx/store';
import { Router } from '@angular/router';
import { AuthActions } from '../commons/actions/athentification.action';

@Component({
  selector: 'app-login',
  templateUrl: './login.component.html',
  styleUrls: ['./login.component.scss'],
})
export class LoginComponent {
  loginForm: FormGroup;

  constructor(
    private fb: FormBuilder,
    private store: Store,
    private router: Router,
  ) {
    this.loginForm = this.fb.group({
      user: ['', Validators.required],
      password: ['', Validators.required],
    });
  }

  onSubmit() {
    const { user, password } = this.loginForm.value;
    if (user === 'test01' && password === 'test01') {
      this.store.dispatch(AuthActions.login({ user }));
      this.router.navigate(['/tareas']);
    } else {
      alert('Credenciales incorrectas');
    }
  }
}
<div class="fondo">
  <section class="LogIn">
    <div class="LogIn__form">
      <div class="LogIn__form-title">
        <h1>Login</h1>
      </div>
      <form
        class="LogIn__form-container"
        [formGroup]="loginForm"
        (ngSubmit)="onSubmit()"
      >
        <div class="form-input">
          <label for="user">Usuario:</label>
          <input class="input" id="user" formControlName="user" type="text" />

          <label for="password">Contraseña:</label>
          <input
            class="input"
            id="password"
            formControlName="password"
            type="password"
          />
        </div>
        <div class="form-button"><button type="submit">Ingresar</button></div>
      </form>
    </div>
  </section>
</div>
